import React, {Component} from 'react';

class CharStatus extends Component{
    constructor(){
        super();
    }

    render(){
        const status = [
            {
                str: "STR",
                pow: "POW",
                dex: "DEX",
                app: "APP",
                siz: "SIZ",
                int: "INT",
                edu: "EDU",
                hp: "HP",
                mp: "MP",
                san: "初期SAN",
                idea: "アイデア",
                luck: "幸運",
                knowledge: "知識"
            }
        ];

        const row = status.map((status, i)=>{
            return(
                    <td>{status}</td>
            )
        })

        return(
            row
        )
    }

}

export default CharStatus;
